            clientesData.sort((a, b) => b.promedio - a.promedio);
            const top13 = clientesData.slice(0, 13);
            
            top13.forEach(item => {
                plotData.push({
                    x: [item.cliente],
                    y: [item.promedio],
                    type: 'bar',
                    name: item.cliente
                });
            });
            
            Plotly.newPlot('plotly-div-daily-consumption', plotData, {
                title: {
                    text: 'Promedio de Consumo Diario por Cliente (MWh)',
                    font: {size: 18}
                },
                xaxis: {
                    title: {
                        text: 'Cliente',
                        font: {size: 14}
                    },
                    tickangle: -45,
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true
                },
                yaxis: {
                    title: {
                        text: 'Promedio Diario (MWh)',
                        font: {size: 14}
                    },
                    showgrid: true,
                    gridcolor: 'lightgray',
                    showline: true,
                    mirror: true
                },
                autosize: true,
                width: 1200,
                height: 600,
                showlegend: false,
                margin: {l: 60, r: 40, t: 80, b: 150}
            });
        }
        document.addEventListener('DOMContentLoaded', function() {
            updateChartDailyConsumption();
        });
        </script>
        </body>
</html>
